import React from 'react';

function AdminHome() {
    return (
        <div className="home-container">
            <div className="card">
                <h2>Card 1</h2>
                <p>This is the content of Card 1.</p>
            </div>
            <div className="card">
                <h2>Card 2</h2>
                <p>This is the content of Card 2.</p>
            </div>
        </div>
    );
}

export default AdminHome;
